  //     let parsedData = {};
  //     if (rawData) {
  //       parsedData = JSON.parse(rawData);
  //       setusername(parsedData.username);
  //       setEmail(parsedData.email);
  //     }
  //   }
  //   init();
  // }, []);

  useEffect(() => {
    fetchNotes();
  }, []);

  async function fetchNotes() {
    const apiData = await API.graphql({ query: queries.listUsers });
    console.log(apiData.data.listUsers.items[0].email);
    // localStorage.setItem('userData', JSON.stringify(apiData.data.listUsers.items[0]));
    setusername(apiData.data.listUsers.items[0].username);
    setEmail(apiData.data.listUsers.items[0].email);
  }

  return (
    <RootStyle>
      <DashboardNavbar onOpenSidebar={() => setOpen(true)} />
      <DashboardSidebar isOpenSidebar={open} onCloseSidebar={() => setOpen(false)} />
      <MainStyle>
        <Outlet />
      </MainStyle>
    </RootStyle>
  );
}
